//SPDX-License-Identifier: MIT
pragma solidity ^0.8;

import "./../interfaces/uniswap.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract DeepTraderV1 is Ownable, IUniswapV2Callee{
    using SafeERC20 for ERC20;

    mapping (uint8 => IUniswapV2Router) internal Routers;
    // mapping (uint8 => address) internal Factories;

    struct tradeParams {
        uint8 routerId; 
        uint256 repay; 
    }
    constructor(
        address _uniRouter,
        address _sushiRouter
    ) public payable {
        Routers[1] = IUniswapV2Router(_uniRouter);
        Routers[2] = IUniswapV2Router(_sushiRouter);
    }

    function startArbitrage(
        address pairAddress,
        uint256 amount0,
        uint256 amount1,
        bytes calldata data
    ) external {
        IUniswapV2Pair(pairAddress).swap(
            amount0,
            amount1,
            address(this), 
            data
        );
    }

    function uniswapV2Call(
        address _sender,
        uint256 _amount0,
        uint256 _amount1,
        bytes calldata _data 
    ) external override{

        address[] memory path = new address[](2);
        tradeParams memory params = abi.decode(_data,(tradeParams));
        IUniswapV2Router router = Routers[params.routerId];

        address token0 = IUniswapV2Pair(msg.sender).token0();
        address token1 = IUniswapV2Pair(msg.sender).token1();

        require(_sender == address(this), "!sender");
        require(_amount0 == 0 || _amount1 == 0, "!amount");

        path[0] = _amount0 == 0 ? token1 : token0;
        path[1] = _amount0 == 0 ? token0 : token1;

        uint256 borrowAmount = _amount0 == 0 ? _amount1 : _amount0;
        ERC20(path[0]).approve(address(router),borrowAmount);
        uint256 receiveAmount = router.swapExactTokensForTokens(
                borrowAmount,    
                params.repay, 
                path, 
                address(this),  
                block.timestamp+300)[1];

        ERC20(path[1]).transfer(msg.sender,params.repay);
    }

    function withdraw (address _assetAddress) public onlyOwner {
        uint256 assetBalance;

        if (_assetAddress == address(0)) {
            address self = address(this);
            assetBalance = self.balance;
            payable(msg.sender).transfer(assetBalance);
        } else {
            assetBalance = ERC20(_assetAddress).balanceOf(address(this));
            ERC20(_assetAddress).safeTransfer(msg.sender, assetBalance);
        }
    }
    receive() external payable {}
}
